import React, { useState, useEffect } from 'react';
import whiteLogo from '../../img/white-logo.png';
import placeholderImage from '../../img/placeholder-image.png';
import headshotPng from '../../img/headshot.png';
import "../../css/Home.css";

export default function Home() {


    const toolList = ['React', 'JS', 'SQL', 'NoSQL', 'APIs', 'Node.js', 'Express', 'HTML', 'CSS', 'Tailwind', 'GraphQL', 'Shopify', Stripe];

    const [toggle, setToggle] = useState(0);

    useEffect(() => {
        const interval = setInterval(() => {
          setToggle(prevToggle => (prevToggle + 1) % toolList.length);
        }, 3000);

        return () => {
          clearInterval(interval);
        };
    }, []);


  return (

    <div id="body">

      <header id="header">



      </header>

        <section id="hero">

          <div id="hero-left">

              <img src={headshotPng} alt="#" id="hero-image"/>

          </div>

          <div id="hero-right">

              <div class="hero-text">

                  <h1 class="hero-heading" id="hello-text">Hey there, I'm Hakim.</h1>

                  <h1 class="hero-heading" id="second-heading">I build captivating Web Applications with <span id="mobile-dynamic" className="dynamic-text">{toolList[toggle]}.</span></h1> 

                  <span id="desktop-dynamic" className="dynamic-text">{toolList[toggle]}.</span>

              </div>

              <div id="hero-button-holder">

                  <a href="https://drive.google.com/file/d/1j3fH-dHo9YyRr_a0jr85Z-VU2msPTGjQ/view?usp=sharing" target="_blank" rel="noreferrer">
                      <button id="resume-button" class="hero-button">Resum√©</button>
                  </a>

                  <a href="https://www.linkedin.com/in/hteasdell">
                      <button id="linkedin-button" class="hero-button" target="_blank" rel="noreferrer">LinkedIn</button>
                  </a>

                  <a href="https://github.com/Hteasdell44">
                      <button id="github-button" class="hero-button" target="_blank" rel="noreferrer">GitHub</button>
                  </a>

              </div>

          </div>

      </section>

    </div>
  );
}
